logger = system.util.getLogger('oeeInstancesMetrics')
metrics = value
order = ["OEE", "Availability", "Quality", "Performance"]

arr = []

try:
    for header in order:
        value = metrics.get(header, None)  # This will get the value or None if the header is not a key in metrics
        if header == 'Availability':
        	color = '#EBB800'
        	legend = True
        elif header == 'Quality':
        	color = '#00EB5F'
        	legend = True
        elif header == 'Performance':
        	color = '#00D2EB'
        	legend = True
        else:
        	color = 'yellow'
        	legend = False
        if value is not None:
            instance = {
                "instanceStyle": {
                    "classes": ""
                },
                "instancePosition": {},
                "Header": header,
                "Units": "",
                "Metric": str(round(value * 100, 2)) + '%',  # or use some formatting if needed
                "ShowLegend": legend,
                "LegendColor": color
            }
            arr.append(instance)

    return arr

except Exception as e:
    logger.warn(str(e))

if value < self.session.custom.AvailabilityThresholds.Bad:
